// BillingForm.js
import React from "react";
import Box from "@mui/material/Box";
import Typography from "@mui/material/Typography";
import Button from "@mui/material/Button";

const BillingForm = ({ biller }) => {
  return (
    <Box
      sx={{
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        justifyContent: "center",
        height: "60vh",
        border: "2px solid #000000",
        width: "25%",
        margin: "15px auto",
        padding: "15px",
      }}
    >
      <Typography variant="h5">{biller.name}</Typography>
      {/* Additional form elements specific to the biller go here */}
      <Button
        variant="contained"
        sx={{
          bgcolor: "#F27C22",
          color: "Black",
          border: "2px solid #000000",
          margin: "10px auto",
        }}
      >
        Next
      </Button>
    </Box>
  );
};

export default BillingForm;
